import { useEffect, useState } from 'react'
import getSerieVideo from '../../services/getSerieVideo'

export function useSerieVideo(id) {
    const [parameter, setParameter] = useState('')


    useEffect(() => {   
        getSerieVideo({ id })
            .then(elements => {
              setTimeout(()=>setParameter(elements),5000)
            }) 
    }, [id]) 


    return parameter
}
